import React from "react";
import "antd/dist/antd.css";
import {
  Form,
  Input,
  Select,
  DatePicker,
  InputNumber,
} from "antd";

export default function FormProducts() {
  const onValueChange = (e) => {
    console.log(e.target.value)
  }
  const onFieldChange = (e) => {
    console.log(e.target.value);
  }
  return (
      <Form onFieldChange={(e)=>onFieldChange(e)} wrapperCol={{ span: 20 }} layout="horizontal">
        <Form.Item  name="products">
          <Input onChange={(e)=>onChange()} placeholder="Product" />
        </Form.Item>
        <Form.Item name="cost">
          <InputNumber placeholder="Cost" />
        </Form.Item>
        <Form.Item name="description">
          <Input placeholder="Description" />
        </Form.Item>
        <Form.Item name="stock">
          <Select placeholder="Stock">
            <Select.Option value="In Stock">In Stock</Select.Option>
            <Select.Option value="Out Stock">Out Stock</Select.Option>
          </Select>
        </Form.Item>
        <Form.Item name="joinDay">
          <DatePicker placeholder="JoinDay" />
        </Form.Item>
      </Form>
  );
}
